window.bookSummaryJSON = "<p>David Baldacci brings back Sean King and Michelle Maxwell - former Secret Service agents turned private investigators, featured in the hit TNT TV series <i>King &amp; Maxwell</i> - in their most surprising, personal, and dangerous case ever.... </p> <p>It seems at first like a simple, tragic story. Tyler Wingo, a teenage boy, learns the awful news that his father, a soldier, was killed in action in Afghanistan. Then the extraordinary happens: Tyler receives a communication from his father...after his supposed death. </p> <p>Tyler hires Sean and Michelle to solve the mystery surrounding his father. But their investigation quickly leads to deeper, more troubling questions. Could Tyler's father really still be alive? What was his true mission? Could Tyler be the next target? </p> <p>Sean and Michelle soon realize that they've stumbled on to something bigger and more treacherous than anyone could have imagined. And as their hunt for the truth leads them relentlessly to the highest levels of power and to uncovering the most clandestine of secrets, Sean and Michelle are determined to help and protect Tyler - though they may pay for it with their lives. </p> <p>(Book 6 of the series)</p>"; 
